const Home = () => {
  const handleClick = (e) => {
    console.log("hello, ninjas", e);
  };

  const handleClickAgain = (name, e) => {
    console.log("Hello, " + name, e.target);
  };

  return (
    <div className="home">
      <h2>Homepage</h2>
      <button onClick={handleClick}>Click me</button>
      <button
        onClick={() => {
          console.log("Hello world");
        }}
      >
        click for anonymus function
      </button>
      <button onClick={(e) => handleClickAgain("Harshal")}>
        Click for name
      </button>
    </div>
  );
};

export default Home;
